import React from 'react';
import { MapContainer, TileLayer, Marker } from 'react-leaflet';
import './MapComponent.css'; // Importe o arquivo CSS para aplicar os estilos

const MapComponent = () => {
  const locations = [
    { lat: -23.5505, lng: -46.6333 },
    // Adicione mais localizações aqui, se necessário
  ];

  return (
    <div className="map-container"> {/* Adicione a classe CSS para o contêiner */}
      <h1>Mapa de Localizações</h1>
      <div id="map">
        <MapContainer center={locations[0]} zoom={13}>
          <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
          {locations.map((location, index) => (
            <Marker key={index} position={location} />
          ))}
        </MapContainer>
      </div>
    </div>
  );
};

export default MapComponent;
